import React from "react";
import "./Departments.css";

export default props => {
    return (
        <button
            type="button"
            className="btn btn-success"
            autoFocus={console.log(props.index===0)}
            onClick={props.departClick}
        >
            {props.depart}
        </button>
    )
}
